    false,nt"url": null,nt"notes": "This annual narrative report for Gulf Island
    National Wildlife Refuges (Petit Bois National Wildlife Refuge, Horn Island National
    Wildlife Refuge, and Breton National Wildlife Refuge) outlines Refuge accomplishments
    during the 1966 calendar year. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, furbearers, predators, rodents, mammals, raptors,
    and reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and prescribed burning. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
